import React from 'react';
import './eventlists.css'

function EventList({handleDelete, events}) {
  return (
    <div className='eventlists'>
        {events.length === 0 && <h1>Not content</h1>}
        {events.map((value) => {
          return(
            <div className="app-info" key={value.id}>
              <h1>{value.title}</h1>
              <h2>{value.date}</h2>
              <button onClick={() => (handleDelete(value.id))}>delete</button>
            </div>
          )
        }) }
      </div> 
  )
}

export default EventList
